--SET UP THE ORDERS AUDIT TABLE.
--START WITH A CLONE OF THE ORDERS TABLE.
CREATE TABLE ORDERS_AUDIT AS SELECT * FROM ORDERS;

--EMPTY THE AUDIT TABLE. WE WILL ADD RECORDS TO THE TABLE AS THEY ARE UPDATED IN THE MASTER ORDERS TABLE.
DELETE FROM ORDERS_AUDIT;

--ADD AN AUDIT DATE FIELD.
ALTER TABLE ORDERS_AUDIT ADD AUDIT_DATE DATE;

--CREATE A TRIGGER THAT ADDS THE ORIGINAL ORDERS RECORD TO THE AUDIT TABLE WHENEVER A RECORD IN THE
--ORDERS TABLE IS UPDATED.
CREATE OR REPLACE TRIGGER ORDERS_BEFORE_UPDATE
BEFORE UPDATE
  ON ORDERS
  FOR EACH ROW
BEGIN
     TOTAL_AMT, CUSTOMER_NO, EMPLOYEE_NO, BRANCH_NO, EXPECTED_SHIP_DATE, EXPECTED_RECEIVE_DATE, ACTUAL_RECEIVE_DATE, 
     AUDIT_DATE)
    VALUES (:OLD.ORDER_NO, :OLD.ORDER_DATE, :OLD.SHIP_DATE, :OLD.SHIPPING_METHOD, :OLD.TAX_STATUS, :OLD.SUBTOTAL, 
            :OLD.TAX_AMT, :OLD.SHIPPING_CHARGE, :OLD.TOTAL_AMT, :OLD.CUSTOMER_NO, :OLD.EMPLOYEE_NO, :OLD.BRANCH_NO, 
            :OLD.EXPECTED_SHIP_DATE, :OLD.EXPECTED_RECEIVE_DATE, :OLD.ACTUAL_RECEIVE_DATE, SYSDATE());
END;
/


