DELETE FROM EMPLOYEE_AUDIT;

--ADD AN AUDIT DATE FIELD.
ALTER TABLE EMPLOYEE_AUDIT ADD AUDIT_DATE DATE;

--CREATE A TRIGGER THAT ADDS THE ORIGINAL EMPLOYEE RECORD TO THE AUDIT TABLE WHENEVER A RECORD IN THE
--EMPLOYEE TABLE IS UPDATED.
CREATE OR REPLACE TRIGGER EMPLOYEE_BEFORE_UPDATE
BEFORE UPDATE
  ON EMPLOYEE
  FOR EACH ROW
BEGIN
     BRANCH_SIZE, POSITION, RATE, COMMISSION, GENDER, AUDIT_DATE)
    VALUES (:OLD.EMPLOYEE_NO, :OLD.LNAME, :OLD.FNAME, :OLD.STREET, :OLD.CITY, :OLD.STATE, :OLD.ZIP, 
            :OLD.STATUS, :OLD.DOB, :OLD.START_DATE, :OLD.END_DATE, :OLD.BRANCH_NO, :OLD.BRANCH_SIZE, 
            :OLD.POSITION, :OLD.RATE, :OLD.COMMISSION, :OLD.GENDER, SYSDATE());
END;
/






