--CREATE A FUNCTION TO GET THE TAX RATE.
CREATE OR REPLACE FUNCTION GET_TAX_RATE (ORDER_NUMBER ORDERS.ORDER_NO%TYPE) RETURN NUMBER 
IS
  TAX_RATE_VAL NUMBER;
  TAX_STATUS_VAL CHAR(1);
BEGIN
  SELECT TAX_STATUS INTO TAX_STATUS_VAL FROM ORDERS WHERE ORDER_NO = ORDER_NUMBER;
  IF TAX_STATUS_VAL = 'y' THEN
    SELECT TAX_RATE INTO TAX_RATE_VAL FROM ORDERS JOIN CUSTOMER ON ORDERS.CUSTOMER_NO = CUSTOMER.CUSTOMER_NO JOIN TAX ON CUSTOMER.STATE = TAX.STATE WHERE ORDER_NO = ORDER_NUMBER;
    RETURN TAX_RATE_VAL;
  ELSE
    RETURN 0;
  END IF;
END;
/

--CHECK THE TAX STATUS OF ALL ORDERS. UPDATE ALL ORDERS WITH THE CORRECT TAX.
CREATE OR REPLACE PROCEDURE UPDATE_ORDER_TAX_AMT
IS
  TAX_AMT_VAL NUMBER;
BEGIN
  FOR ORDER_RECORDS IN (SELECT ORDER_NO, SUBTOTAL, TAX_AMT FROM ORDERS) LOOP
    TAX_AMT_VAL := ORDER_RECORDS.SUBTOTAL * GET_TAX_RATE(ORDER_RECORDS.ORDER_NO);

    IF TAX_AMT_VAL <> ORDER_RECORDS.TAX_AMT THEN
      UPDATE ORDERS SET TAX_AMT = TAX_AMT_VAL WHERE ORDER_NO = ORDER_RECORDS.ORDER_NO;
    END IF;
  END LOOP;
END;
/
--EXECUTE THE PROCEDURE TO UPDATE THE RECORDS.
EXEC UPDATE_ORDER_TAX_AMT;
/

--Prepare the database by populating the orders fields with proper values.
--Update the subtotal, the shipping charge, the tax and the total amount attributes of the orders
--table.

--Update Subtotal Procedure

CREATE or REPLACE 
PROCEDURE UPDATE_SUBTOTAL is

v_order_no orderline.order_no%type;
v_subtotal   number(15); 

CURSOR product_orderline_cur is
SELECT ol.order_no, sum(p.unit_price * ol.qty) as subtotal
from product p, orderline ol
where p.product_no = ol.product_no
group by ol.order_no;

BEGIN
OPEN product_orderline_cur;
LOOP
	FETCH product_orderline_cur into v_order_no, v_subtotal;
	EXIT when product_orderline_cur%notfound;
	-- store subtotal in orders table
	UPDATE orders
	SET subtotal = v_subtotal  
	WHERE order_no = v_order_no;
END LOOP;
--an order may be created but no orderlines added yet,insert a 0
UPDATE orders
SET subtotal = 0
WHERE subtotal is null;
CLOSE product_orderline_cur;
END;
/
show errors;

--Update Shipping Charge Procedure

CREATE or REPLACE 
PROCEDURE UPDATE_SHIPPING_CHARGE is

v_shipping_method  orders.shipping_method%type;
v_subtotal    	orders.subtotal%type;
v_order_no  orders.order_no%type;
V_shipping_cost number;

CURSOR orders_cur is
SELECT order_no, shipping_method, subtotal
from orders;

BEGIN

OPEN orders_cur;

LOOP
	FETCH orders_cur into v_order_no, v_shipping_method, v_subtotal;
	
	EXIT when orders_cur%notfound;
	
	IF UPPER(v_shipping_method) = 'GROUND' THEN
		V_shipping_cost := .05;
				
	ELSIF UPPER(v_shipping_method) = '1DAY' THEN
		V_shipping_cost :=   .15;
		
	ELSIF UPPER(v_shipping_method) = '1DAY-AIR' THEN
		V_shipping_cost :=   .15;
			
	ELSIF UPPER(v_shipping_method) = '1-DAY' THEN
		V_shipping_cost :=  .15;
		
	ELSIF UPPER(v_shipping_method) = '2DAY' THEN
		V_shipping_cost :=   .10;
	
	ELSIF UPPER(v_shipping_method) = '2DAY-AIR' THEN
		V_shipping_cost :=   .10;
	
	ELSIF UPPER(v_shipping_method) = '2-DAY' THEN
		V_shipping_cost :=   .10;
		
	ELSE 
              v_shipping_cost := 0;
             
	END IF;

	UPDATE ORDERS
	SET shipping_charge = v_subtotal * v_shipping_cost
	WHERE order_no = v_order_no;

END LOOP;

CLOSE orders_cur;

END;
/
show errors;

--Update Tax 

CREATE or REPLACE 
PROCEDURE UPDATE_TAX is

v_subtotal  orders.subtotal%type;
v_order_no  orders.order_no%type;
V_tax_rate  tax.tax_rate%type;
v_tax_status orders.tax_status%type;
v_tax_amount orders.tax_amt%type;

CURSOR tax_cur is
SELECT o.order_no,  t.tax_rate, o.subtotal, o.tax_status
from orders o, customer c, tax t
where o.customer_no = c.customer_no
and c.state = t.state;

BEGIN

OPEN tax_cur;

LOOP
	FETCH tax_cur into v_order_no, v_tax_rate, v_subtotal, v_tax_status;
	
	EXIT when tax_cur%notfound;
	

	IF UPPER(v_tax_status) = 'Y' THEN
		v_tax_amount := v_subtotal * v_tax_rate;
		
	ELSE 
		v_tax_amount := 0;           

	END IF;

	UPDATE ORDERS
	SET tax_amt = v_tax_amount
	WHERE order_no = v_order_no;

END LOOP;

CLOSE tax_cur;

END;
/
show errors;

--Update Total Amount Procedure

CREATE or REPLACE 
PROCEDURE UPDATE_TOTAL_AMT is

v_order_no  orders.order_no%type;
v_subtotal  orders.subtotal%type;
v_tax_amount orders.tax_amt%type;
v_shipping_charge orders.shipping_charge%type;

CURSOR total_cur is
SELECT o.order_no, o.subtotal, o.tax_amt, o.shipping_charge
from orders o;

BEGIN

OPEN total_cur;

LOOP
	FETCH total_cur into v_order_no,  v_subtotal, v_tax_amount, v_shipping_charge;
	
	EXIT when total_cur%notfound;
	
	UPDATE ORDERS
	SET total_amt = v_subtotal + v_tax_amount + v_shipping_charge
	WHERE order_no = v_order_no;

END LOOP;

CLOSE total_cur;

END;
/
show errors; 

--execute the update procedures to populate the orders table

EXECUTE UPDATE_SUBTOTAL;
EXECUTE UPDATE_SHIPPING_CHARGE;
EXECUTE UPDATE_TAX;
EXECUTE UPDATE_TOTAL_AMT;

