--- Use case 5.3 ---

--1. All sales Employees with 10 years or less of employment will receive 3% COMMISSION

--?Develop a user defined function to revise the database to reflect the following business rules
--         1.	All sales Employees with 10 years or less of employment will receive 3% COMMISSION
--         2.	Employees with years of experience in the range of >10 but less than 20 will receive 5% commission
--         3.	Employees with years of experience in the range of >20 but less than 25 will receive 7% commission
--         4.	Employees with years of experience in the range of >25 but less than 30 will receive 8% commission
--         5.	Employees with years of experience over 30 years will receive 10% commission

----- CREATE FUNCTION

CREATE OR REPLACE FUNCTION CALC_EMP_COMMISSION_FN(P_IN_EMPLOYEE_NO IN EMPLOYEE.EMPLOYEE_NO%TYPE) RETURN NUMBER AS
V_COMMISSION EMPLOYEE.COMMISSION%TYPE;
V_START_DATE EMPLOYEE.START_DATE%TYPE;
BEGIN
SELECT START_DATE INTO V_START_DATE FROM EMPLOYEE WHERE EMPLOYEE_NO = P_IN_EMPLOYEE_NO;
IF TRUNC(MONTHS_BETWEEN(SYSDATE,V_START_DATE) / 12) <= 10 THEN
    V_COMMISSION := 0.03;
ELSIF TRUNC(MONTHS_BETWEEN(SYSDATE,V_START_DATE) / 12) BETWEEN 11 AND 20 THEN
    V_COMMISSION := 0.05;
ELSIF TRUNC(MONTHS_BETWEEN(SYSDATE,V_START_DATE) / 12) BETWEEN 21 AND 25 THEN
    V_COMMISSION := 0.07;
ELSIF TRUNC(MONTHS_BETWEEN(SYSDATE,V_START_DATE) / 12) BETWEEN 26 AND 30 THEN
    V_COMMISSION := 0.08;
ELSIF TRUNC(MONTHS_BETWEEN(SYSDATE,V_START_DATE) / 12) > 30 THEN
    V_COMMISSION := 0.1;
END IF;

RETURN V_COMMISSION;

EXCEPTION WHEN NO_DATA_FOUND THEN RETURN NULL;
END CALC_EMP_COMMISSION_FN;

/

