--?Paying commission values
--         1.	Create a table to keep track of Commission for each year for every employee.
--         2.	It is calculated after the returns are subtracted from sales will be calculated by multiplying
--         3.	Commission is paid at the end of the year.

----- CREATE TABLE

CREATE TABLE EMPLOYEE_YEARLY_COMMISSION
(
  EMPLOYEE_NO NUMBER (38,0) NOT NULL,
  YEAR NUMBER(4),
  COMMISSION NUMBER
);

----- INSERT INTO TABLE
EMPLOYEE_NO,
YEAR,
COMMISSION
)
SELECT
A.EMPLOYEE_NO,
EXTRACT(YEAR FROM ORDER_DATE) AS YEAR,
CALC_EMP_COMMISSION_FN (A.EMPLOYEE_NO) * SUM(B.TOTAL_AMT - AMOUNT_REFUNDED) AS YEAR_COMMISSION
FROM EMPLOYEE A
LEFT JOIN ORDERS B ON A.EMPLOYEE_NO = B.EMPLOYEE_NO
LEFT JOIN ORDERLINE C ON B.ORDER_NO = C.ORDER_NO
LEFT JOIN RETURNPROD D ON C.ORDERLINE_NO = D.ORDERLINE_NO
GROUP BY A.EMPLOYEE_NO, EXTRACT(YEAR FROM ORDER_DATE) ORDER BY A.EMPLOYEE_NO,EXTRACT(YEAR FROM ORDER_DATE);
/
