-- 6.1 #3
-- For every purchase made from a vendor for the quantity purchased, the quantity on hand in product tables has to increase
--------------------------------------------------------------------------------
CREATE OR REPLACE
TRIGGER PRODVENDOR_QOH
BEFORE INSERT OR UPDATE ON PRODVENDOR FOR EACH ROW
DECLARE
NEW_QOH PRODUCT.QOH%TYPE;
OLD_QOH PRODUCT.QOH%TYPE;
BEGIN
  SELECT QOH INTO OLD_QOH FROM PRODUCT WHERE PRODUCT_NO = :NEW.PRODUCT_NO;
  NEW_QOH := OLD_QOH + :NEW.VEND_QTY;
  UPDATE PRODUCT SET QOH = NEW_QOH WHERE PRODUCT_NO = :NEW.PRODUCT_NO;
END;
/


-- For every sale made in orders table and QTY posted in the order_line table is the base to subtract from the QOH. So QOH in part table should decrease by the QTY amount

ALTER TABLE PRODUCT ADD(ACTUAL_ORDER NUMBER(38) NULL);
--------------------------------------------------------------------------------
CREATE OR REPLACE
TRIGGER ORDERLINE_BIU
BEFORE INSERT OR UPDATE ON ORDERLINE FOR EACH ROW
DECLARE
PRODUCT_ROW PRODUCT%ROWTYPE;
NEW_QOH PRODUCT.QOH%TYPE;
BEGIN
  SELECT *INTO PRODUCT_ROW FROM PRODUCT WHERE PRODUCT_NO = :NEW.PRODUCT_NO;
    NEW_QOH := PRODUCT_ROW.QOH - :NEW.QTY;
        IF NEW_QOH >= 0 AND NEW_QOH >= PRODUCT_ROW.ORDER_LEVEL THEN

            UPDATE PRODUCT SET QOH = NEW_QOH WHERE PRODUCT_NO = :NEW.PRODUCT_NO;

        ELSIF NEW_QOH >= 0 AND NEW_QOH < PRODUCT_ROW.ORDER_LEVEL THEN

            IF PRODUCT_ROW.BACK_ORDER = 0 THEN

                UPDATE PRODUCT SET ACTUAL_ORDER = ORDER_QTY WHERE PRODUCT_NO = :NEW.PRODUCT_NO;

            END IF;

        ELSIF NEW_QOH < 0 THEN

            UPDATE PRODUCT SET BACK_ORDER = :NEW.QTY, ACTUAL_ORDER = PRODUCT_ROW.ORDER_QTY + :NEW.QTY WHERE PRODUCT_NO = :NEW.PRODUCT_NO;

        END IF;

            UPDATE PRODUCT SET AVAIL_DATE = (SELECT EXPECTED_RECEIVE_DATE FROM ORDERS WHERE ORDER_NO = :NEW.ORDER_NO) WHERE PRODUCT_NO = PRODUCT_ROW.PRODUCT_NO;
END;
/

