-- REPORT FOR comparing Product.Order_level and Product.Order_qty against Prodvendor.Vend_qty
CREATE OR REPLACE PROCEDURE GET_ORDER_PRODVENDOR_COMPARE
IS
CURSOR DATAREC IS
  SELECT P.PRODUCT_NO, ORDER_LEVEL, NVL(ORDER_QTY, 0) AS ORDER_QTY, NVL(VEND_QTY, 0) AS VEND_QTY
  FROM
  PRODUCT P JOIN PRODVENDOR PV ON P.PRODUCT_NO = PV.PRODUCT_NO
  ORDER BY PRODUCT_NO;
  
BEGIN  
  DBMS_OUTPUT.PUT_LINE('===============================================================================================================================================================');
  DBMS_OUTPUT.PUT_LINE('***COMPARISON OF PRODUCT.ORDER_LEVEL AND PRODUCT.ORDER_QTY AGAINST PRODVENDOR.VEND_QTY***');
  DBMS_OUTPUT.PUT_LINE('===============================================================================================================================================================');
  DBMS_OUTPUT.PUT_LINE(RPAD('PRODUCT_NO', 15)||' '||RPAD('ORDER_LEVEL', 15)||' '||RPAD('ORDER_QTY', 15)||' '||RPAD('VEND_QTY', 15));
  DBMS_OUTPUT.PUT_LINE('===============================================================================================================================================================');
  FOR L IN DATAREC LOOP
  DBMS_OUTPUT.PUT_LINE(RPAD(L.PRODUCT_NO, 15)||' '||RPAD(L.ORDER_LEVEL, 15)||' '||RPAD(L.ORDER_QTY, 15)||' '||RPAD(L.VEND_QTY, 15));
  END LOOP;
  
  EXCEPTION
  WHEN OTHERS THEN
  NULL;
END GET_ORDER_PRODVENDOR_COMPARE;
/
