ALTER TABLE CUSTOMER
ADD INTEREST_RATE NUMBER;

-- Store credit card has a 10% annual interest charge

UPDATE CUSTOMER
SET INTEREST_RATE = (10/100)
WHERE CUSTOMER_NO IN (SELECT DISTINCT(CUSTOMER_NO)
                        FROM PAYMENT_DATA 
                        WHERE PAY_METHOD = 'credit');


-- Every customer with store Credit Card (SCC) has a beginning credit limit of 5000.

UPDATE CUSTOMER 
SET CREDIT_LIMIT = 5000
WHERE CUSTOMER_NO IN (SELECT DISTINCT(CUSTOMER_NO)
                        FROM ORDERS
                        WHERE PAY_TYPE = 'credit');

-- Account receivable should generate 5% interest per year

ALTER TABLE CUSTOMER
ADD INTEREST NUMBER ;

update customer c
set c.interest = (select  (B.sum_amt * 0.05) as interest from
(select   customer_no, sum(amt_paid) as sum_amt from payment_data  where pay_method = 'AR' group by customer_no order by customer_no ) B
where c.customer_no = B.customer_no);

-- Unpaid balance should be added monthly to the balance field in customer table
update customer c
set c.balance =( select D.balance  from ( select   B.customer_no,sum( B.bal)  as balance
from (select p.customer_no, (total_amt - amt_paid) as  bal from payment_data p, orders o
where p.customer_no = o.customer_no and  p.order_no= o.order_no and pay_method = 'AR' ) B  group by B.customer_no  order by B.customer_no)D
where c.customer_no = D.customer_no);
						
-- Create a report to show balance of each payment type

SELECT  P.PAY_METHOD AS PAYMENT_TYPE, ROUND(SUM(C.BALANCE),2) AS BALANCE
FROM CUSTOMER C 
JOIN PAYMENT_DATA P ON C.CUSTOMER_NO = P.CUSTOMER_NO
GROUP BY P.PAY_METHOD;

-- create a report to show balances of each payment type for each customer

SELECT C.CUSTOMER_NO, P.PAY_METHOD, ROUND(SUM(C.BALANCE),2) AS Balance
FROM CUSTOMER C
JOIN PAYMENT_DATA P ON C.CUSTOMER_NO = P.CUSTOMER_NO
GROUP BY C.CUSTOMER_NO, P.PAY_METHOD
ORDER BY C.CUSTOMER_NO;

-- create a report to show balances of each payment type for each customer for every year 

SELECT C.CUSTOMER_NO, O.PAY_TYPE, SUBSTR(O.ORDER_DATE, 8,2) AS YEAR, SUM(C.BALANCE) AS BALANCE
FROM CUSTOMER C JOIN ORDERS O ON C.CUSTOMER_NO = O.CUSTOMER_NO
GROUP BY C.CUSTOMER_NO, O.PAY_TYPE, SUBSTR(O.ORDER_DATE,8,2)
ORDER BY SUBSTR(O.ORDER_DATE,8,2), C.CUSTOMER_NO;

