--You may want to consider developing a UDF or stored procedure to receive order dates and product number and return the correct sale price
CREATE OR REPLACE FUNCTION FNGETSALESPRICE
(
    P_ORDER_DATE DATE,
    P_PRODUCT_NO INT
) RETURN NUMBER IS
    V_PRICE NUMBER(19,2) := 0;
BEGIN
    SELECT
    OL.QTY * (pr.unit_price - (pr.unit_price * nvl(p.discount,0))) Sales_Price
    INTO V_PRICE
    from Orders O
    inner join orderline OL on OL.Order_No = O.Order_No
    inner join Product pr on pr.PRODUCT_NO = ol.product_no
    left join PROMOTIONAL_PLANS P on O.Order_Date >= P.START_DATE and O.Order_Date <= P.END_DATE
    where o.order_date = P_ORDER_DATE--'12-Feb-2002'
    and pr.product_no = P_PRODUCT_NO;--110;
    RETURN V_PRICE;
END;
