---creating product1 with reference of product

create table product1 as (select * from product);

---creating product_update table to update the values in the product table using procedure

--drop table product_latest;

create table product_latest (
Product_no	NUMBER (38,0),
QOH	NUMBER (38,0),
Product_Description CHAR(100),
Unit_Price	NUMBER (38,0),
Unit_Cost	NUMBER (38,0),
Order_Level NUMBER (38,0),
Back_Order NUMBER (38,0),
Avail_date	 DATE  null,
Damaged_Qty NUMBER (38,0));

--inserting values

create or replace  PROCEDURE product_update (
    p_prod_no IN VARCHAR2 default null  
) IS
--
    CURSOR c1 IS
    SELECT
       * from product_latest
       where PRODUCT_NO = nvl(p_prod_no,PRODUCT_NO);        
--
BEGIN 
--
    FOR i IN c1 LOOP
--
   update product1
   set qoh = i.qoh
   where PRODUCT_NO = i.PRODUCT_NO;
   COMMIT;
   --
    END LOOP;
--
EXCEPTION 
--
    WHEN OTHERS THEN
--
ROLLBACK;
        dbms_output.put_line('ERROR:' || sqlerrm);
--
END product_update;

--calling procedure 
begin
PRODUCT_UPDATE(null);
end;
