--Trigger on the orderline table when value inserted into the orderline and the order_qty is more Qoh it updates value in the backorder

CREATE OR REPLACE TRIGGER order_line_insert BEFORE
    INSERT ON orderline
    FOR EACH ROW
DECLARE
    l_current_qty NUMBER;
    l_prod_qoh    NUMBER;
    qoh_issue exception;
   -- PRAGMA AUTONOMOUS_TRANSACTION;
BEGIN
--
    SELECT
        sum(qty)
    INTO l_current_qty
    FROM
        orderline
    WHERE
        product_no = :new.product_no;

    SELECT
        qoh
    INTO l_prod_qoh
    FROM
        product1
    WHERE
        product_no = :new.product_no;

    IF l_current_qty >= l_prod_qoh THEN
    
            backorder_no,
            product_no,
            bo_qty,
            bo_date
        ) VALUES (
            backorderno_seq.nextval,
            :new.product_no,
            :new.qty,
            sysdate
        );
--  commit;
 -- raise qoh_issue;
  --      raise_application_error(-20111, 'Quantity is not avilable at product level');
    END IF;


END;

